//It's okay to be the first one to take an initiative. It's okay if you are the one who is taking an initiative to talk to your long lost friend or anyone with whome you have lost the contact. Yes it will be a bit hard to text the person with whome you have not spoken for a year or months. You will be a bit nervous or scared to talk. While you wrestle with the possibility that things may not go back to how they were, I just hope you know that there is a possibility that things may go back to how they were. Yes there are bad time but there are good times too when you feel so happy and fresh that you feel dancing or just smiling the whole time. Remember one thing god will never give battles that you cant deal with you are stronger than you think and stronger than you know. Yes it is hard to sync up with waves of life, ups and downs and hardships but " yehi toh zindagi hai, sirf khushiyan hi millengi, toh unki emhiyat kam nahi ho jayegi? Remember every phase of life teaches us something. A good phase doesn't last forver neither can a bad one. So go call that one friend or anyone whome you miss but you are scared to talk. Do everything which makes you feel yourself. You are a goddamn worrier. You are the strongest and bestest person anyone can have ,so go do whatever you want, life is beautiful and we should enjoy it the to fullest.//🌼

~Niapandya 

